import React from "react";

function Movie(props){
    return(
        <div>
            <h1>
                {`이 영화의 이름은 ${props.name}입니다.`}
            </h1>
            <h2>
                {`이 영화의 제작년도는 ${props.date}입니다.`}
            </h2>
        </div>
    )
}

export default Movie;
